import React, { useState, useEffect } from 'react';

function Books() {
  const [data, setData] = useState([]);

  useEffect(() => {
    fetch('http://localhost:7070/books')
      .then(response => response.json())
      .then(data => setData(data));
  }, []);

  return (
    <div>
      {data.map(item => (
        <div key={item.id}>
          <h2>{item.title}</h2>
          <p>{item.description}</p>
        </div>
      ))}
    </div>
  );
}

export default Books;
